import { gql, useQuery } from '@apollo/client';

export const PRODUCTS_QUERY = gql`
  query products {
    products {
      id
      name
      ... on Shirt {
        shirtColor: color
        size
      }
      ... on Pants {
        color
        width
        length
      }
    }
  }
`;

export default function Products(): JSX.Element {
  const { data } = useQuery(PRODUCTS_QUERY);
  const products = data.products;
  console.log(products);
  return (
    <div>
      <ul></ul>
    </div>
  );
}
